import { Box, Button, SxProps, Theme, Typography } from "@mui/material";
import { useEffect, useCallback } from "react";
import { useState } from 'react';
import { C1, D1, E1, F1, G1, A1, B1, C2, D2, E2, F2, G2, A2, B2, C3, D3, E3, F3, G3, A3, B3, C4, D4, E4, F4, G4, A4, B4, C5, D5, E5, F5, G5, A5, B5, C6, D6, E6, F6, G6, A6, B6, C7, D7, E7, F7, G7, A7, B7, C8, Db1, Eb1, Gb1, Ab1, Bb1, Db2, Eb2, Gb2, Ab2, Bb2, Db3, Eb3, Gb3, Ab3, Bb3, Db4, Eb4, Gb4, Ab4, Bb4, Db5, Eb5, Gb5, Ab5, Bb5, Db6, Eb6, Gb6, Ab6, Bb6, Db7, Eb7, Gb7, Ab7, Bb7, } from "../../resources/piano/";
import file from "../../resources/SongFile/test1.json";

const Sample = () => {

    // Web Audio APIのコンテキストを作成
    const audioContext = new (window.AudioContext || window.webkitAudioContext)();

    // 音声ファイルを読み込む関数
    async function loadAudioFile(url: string): Promise<AudioBuffer> {
        const response = await fetch(url);
        const arrayBuffer = await response.arrayBuffer();
        return await audioContext.decodeAudioData(arrayBuffer);
    }

    // 音声ファイルのURL
    const audioFileUrl = 'path/to/audio-file.mp3'; // あなたの音声ファイルのパスを指定

    // 音程の変更倍率を計算する関数
    function getPitchRatio(note: number): number {
        // MIDIノート番号を周波数に変換する式: frequency = 2 ** ((note - 69) / 12) * 440
        return 2 ** ((note - 69) / 12);
    }

    // 音程を変更して再生する関数
    function playSoundWithPitch(note: number): void {
        loadAudioFile(audioFileUrl)
            .then(audioBuffer => {
                // 音程の変更倍率を取得
                const pitchRatio = getPitchRatio(note);

                // AudioBufferSourceNodeを作成
                const source = audioContext.createBufferSource();
                source.buffer = audioBuffer;

                // 音程を変更するために音源を周波数でスケーリング
                const playbackRate = audioContext.sampleRate / audioBuffer.sampleRate * pitchRatio;
                source.playbackRate.value = playbackRate;

                // 出力に接続して再生
                source.connect(audioContext.destination);
                source.start();
            })
            .catch(error => {
                console.error('音声ファイルの読み込みに失敗しました:', error);
            });
    }


    const [C1_, C1__] = useState('#FFF'), [D1_, D1__] = useState('#FFF'), [E1_, E1__] = useState('#FFF'), [F1_, F1__] = useState('#FFF'), [G1_, G1__] = useState('#FFF'), [A1_, A1__] = useState('#FFF'), [B1_, B1__] = useState('#FFF')
    const [C2_, C2__] = useState('#FFF'), [D2_, D2__] = useState('#FFF'), [E2_, E2__] = useState('#FFF'), [F2_, F2__] = useState('#FFF'), [G2_, G2__] = useState('#FFF'), [A2_, A2__] = useState('#FFF'), [B2_, B2__] = useState('#FFF')
    const [C3_, C3__] = useState('#FFF'), [D3_, D3__] = useState('#FFF'), [E3_, E3__] = useState('#FFF'), [F3_, F3__] = useState('#FFF'), [G3_, G3__] = useState('#FFF'), [A3_, A3__] = useState('#FFF'), [B3_, B3__] = useState('#FFF')
    const [C4_, C4__] = useState('#FFF')

    const [Db1_, Db1__] = useState('#000'), [Eb1_, Eb1__] = useState('#000'), [Gb1_, Gb1__] = useState('#000'), [Ab1_, Ab1__] = useState('#000'), [Bb1_, Bb1__] = useState('#000')
    const [Db2_, Db2__] = useState('#000'), [Eb2_, Eb2__] = useState('#000'), [Gb2_, Gb2__] = useState('#000'), [Ab2_, Ab2__] = useState('#000'), [Bb2_, Bb2__] = useState('#000')
    const [Db3_, Db3__] = useState('#000'), [Eb3_, Eb3__] = useState('#000'), [Gb3_, Gb3__] = useState('#000'), [Ab3_, Ab3__] = useState('#000'), [Bb3_, Bb3__] = useState('#000')


    let piano_count = 2;
    let start = Boolean(false);
    let time = 0;
    let recordList: any[] = [];

    function colorChange(num: number) {
        if (num === 0) { C1__("#990000") }; if (num === 22) { Db1__("#990000") }; if (num === 1) { D1__("#990000") }; if (num === 23) { Eb1__("#990000") }; if (num === 2) { E1__("#990000") }; if (num === 3) { F1__("#990000") }; if (num === 24) { Gb1__("#990000") }; if (num === 4) { G1__("#990000") }; if (num === 25) { Ab1__("#990000") }; if (num === 5) { A1__("#990000") }; if (num === 6) { B1__("#990000") }; if (num === 26) { Bb1__("#990000") };
        if (num === 7) { C2__("#990000") }; if (num === 27) { Db2__("#990000") }; if (num === 8) { D2__("#990000") }; if (num === 28) { Eb2__("#990000") }; if (num === 9) { E2__("#990000") }; if (num === 10) { F2__("#990000") }; if (num === 29) { Gb2__("#990000") }; if (num === 11) { G2__("#990000") }; if (num === 30) { Ab2__("#990000") }; if (num === 12) { A2__("#990000") }; if (num === 13) { B2__("#990000") }; if (num === 31) { Bb2__("#990000") };
        if (num === 14) { C3__("#990000") }; if (num === 32) { Db3__("#990000") }; if (num === 15) { D3__("#990000") }; if (num === 33) { Eb3__("#990000") }; if (num === 16) { E3__("#990000") }; if (num === 17) { F3__("#990000") }; if (num === 34) { Gb3__("#990000") }; if (num === 18) { G3__("#990000") }; if (num === 35) { Ab3__("#990000") }; if (num === 19) { A3__("#990000") }; if (num === 20) { B3__("#990000") }; if (num === 36) { Bb3__("#990000") };
        if (num === 21) { C4__("#990000") };
        resetColor();
    }


    function handleKeyDown(event: any, recordList: any[]) {
        let soundfile = [C1, Db1, D1, Eb1, E1, F1, Gb1, G1, Ab1, A1, Bb1, B1, C2, Db2, D2, Eb2, E2, F2, Gb2, G2, Ab2, A2, Bb2, B2, C3, Db3, D3, Eb3, E3, F3, Gb3, G3, Ab3, A3, Bb3, B3, C4, Db4, D4, Eb4, E4, F4, Gb4, G4, Ab4, A4, Bb4, B4, C5, Db5, D5, Eb5, E5, F5, Gb5, G5, Ab5, A5, Bb5, B5, C6, Db6, D6, Eb6, E6, F6, Gb6, G6, Ab6, A6, Bb6, B6, C7, Db7, D7, Eb7, E7, F7, Gb7, G7, Ab7, A7, Bb7, B7, C8]

        if (event.keyCode === 39 && piano_count < 4) {
            piano_count += 1;
        }
        if (event.keyCode === 37 && piano_count > 0) {
            piano_count -= 1;
        }
        if (event.key === 'q') {
            let sound = new Audio(soundfile[0 + piano_count * 12]); sound.play(); C1__("#990000"); resetColor(); if (start) { recordList.push([Date.now() - time, 0 + piano_count * 7]) }
        }
        if (event.key === '2') {
            let sound = new Audio(soundfile[1 + piano_count * 12]); sound.play(); Db1__("#990000"); resetColor(); if (start) { recordList.push([Date.now() - time, 50 + piano_count * 5]) }
        }
        if (event.key === 'w') {
            let sound = new Audio(soundfile[2 + piano_count * 12]); sound.play(); D1__("#990000"); resetColor(); if (start) { recordList.push([Date.now() - time, 1 + piano_count * 7]) }
        }
        if (event.key === '3') {
            let sound = new Audio(soundfile[3 + piano_count * 12]); sound.play(); Eb1__("#990000"); resetColor(); if (start) { recordList.push([Date.now() - time, 51 + piano_count * 5]) }
